// geoprumo/frontend/src/components/Points/PointsList.jsx

import React from 'react';

function PointsList({ route, onEnrich, isEnriching }) {
  if (!route || route.length === 0) {
    return (
      <div className="bg-gray-100 p-4 rounded-lg flex items-center justify-center h-full">
        <p className="text-gray-500">Aguardando pontos para exibir a rota...</p>
      </div>
    );
  }

  return (
    <div className="flex flex-col h-full">
      <div className="flex justify-between items-center mb-2">
        <h2 className="text-xl font-bold text-gray-700">2. Pontos da Rota</h2>
        <button
          onClick={onEnrich}
          disabled={isEnriching}
          className="bg-purple-600 text-white font-bold py-2 px-3 rounded-lg hover:bg-purple-700 disabled:bg-gray-400 flex items-center text-sm"
        >
          {isEnriching ? 'Enriquecendo...' : '✨ Enriquecer com IA'}
        </button>
      </div>

      <div className="overflow-y-auto flex-grow">
        <ul>
          {route.map((point) => (
            <li key={point.order} className="bg-white p-3 mb-2 rounded-lg shadow-sm border border-gray-200">
              <div className="flex items-start">
                <span className="bg-blue-500 text-white rounded-full h-6 w-6 text-sm flex items-center justify-center font-bold mr-3">
                  {point.order}
                </span>
                <div className="flex-grow">
                  <p className="font-semibold text-gray-800">{point.name}</p>
                  <p className="text-xs text-gray-500">
                    Lat: {point.latitude.toFixed(5)}, Lon: {point.longitude.toFixed(5)}
                  </p>
                  {point.address && (
                    <p className="text-xs text-gray-600 mt-1">
                      <strong>Endereço:</strong> {point.address}
                    </p>
                  )}
                  {point.category && (
                     <p className="text-xs text-gray-600 mt-1">
                      <strong>Categoria:</strong> {point.category}
                    </p>
                  )}
                </div>
              </div>
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default PointsList;
